/*
目标:  得物App 抓包心愿森林heders里的x-auth-token 和SK 用&连接不分顺序

格式：export dewu="token=Bearer eyJhxxxxxxxx&sk=xxx"  多账号换行隔开

cron 32 5,36 8,12,18,22 * * ? 每天跑6-8次

注意: 每个号当日只有一次助力机会，所以无法互助
青龙变量放在配置文件，不然青龙默认分割ck跟我写的有冲突
*/

const $ = new Env("得物心愿森林");
let envSplitor = ['\n']  //多账号隔开方式，默认换行可自定义
let appVersion = '5.11.5'       //app版本可有可无
let helpme = 1; //需要助力的账号顺序

const fs = require('fs')
const path = require('path')
let strShare = './dewu.json';
let Fileexists = fs.existsSync(strShare);
let TempShareCache = [];
let dewucode = ''
if (Fileexists) {
$.logAndNotify("检测到互助码缓存文件已存在");
TempShareCache = fs.readFileSync(strShare, 'utf-8');
if (TempShareCache) {
TempShareCache = JSON.parse(TempShareCache);
 dewucode= TempShareCache[0].dewu.trim();
}
}else{
$.logAndNotify("未检测到互助码缓存文件，去创建...");
var str = JSON.stringify(TempShareCache, null, 2);
fs.writeFile(strShare, str, function (err) {
if (err) {
console.log(err);
$.logAndNotify("缓存文件创建失败!");
} else {
$.logAndNotify("缓存文件创建成功");
    }
})
}

